import React, { useState } from 'react';
import { View, Image, ImageBackground, StyleSheet, Text, TextInput } from 'react-native';
import { Feather as Icon } from '@expo/vector-icons';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { Ionicons } from "react-native-vector-icons";

import styles from './estilo';

export default function tPerfilBaba({ route }) {
    
    const navigation = useNavigation();
    const { imagem, nome, email, celular, descricao } = route.params;

    function Voltar() {
        navigation.goBack()
    }

    return (
        <View style={styles.container}>
            <Ionicons
                name="chevron-back"
                size={40}
                color="black"
                onPress={Voltar}    
            />
            <View style={styles.card}>
                <View style={styles.cardHeader}>
                    <Image source={{ uri: imagem }} style={styles.cardImage} />
                    <View style={styles.cardTitle}>
                        <Text style={styles.cardTitleText}>{nome}</Text>
                    </View>
                </View>
                <View style={styles.cardContent}>
                    <View style={styles.cardRow}>
                        <Icon name="mail" size={20} color="#333" />
                        <Text style={styles.cardText}>{email}</Text>
                    </View>
                    <View style={styles.cardRow}>
                        <Icon name="phone" size={20} color="#333" />
                        <Text style={styles.cardText}>{celular}</Text>
                    </View>
                    <View style={styles.cardRow}>
                        <Icon name="align-left" size={20} color="#333" />
                        <Text style={styles.cardText}>{descricao}</Text>
                    </View>
                </View>
            </View>
        </View>
    );
}
